body:
I tested performance on SSB. Since Vectorized engine doesn't support native UDF, I ran Java UDF and native UDF on vectorized engine and row-based engine separately. And a simple `AddOne` UDF for non-null int type is used for both Java UDF and native UDF.

I got results below,
`set enable_vectorized_engine=true;
select java_udf_add_one(c_custkey) from customer;
3000000 rows in set (49.02 sec)

set enable_vectorized_engine=false;
select native_udf_add_one(c_custkey) from customer;
3000000 rows in set (49.77 sec)`

which means there is no obvious performance gap between Java UDF and native UDF.
In the future, we should consider to provide a Doris Java UDF interface in order to support more complex types, such as HLL, Date, etc.
